message:
Load default shared preferences on first run, etc.

Put DEFAULT_CLEF, DEFAULT_PITCH_ARRAY, and DEFAULT_INTERVAL_ARRAY
into SharedPreferences using an Editor if no preferences exist.
Permanently remove pitch and interval arrays from arrays.xml.
Add the empty string to represent the lack of any accidentals.

Run Inspect Code from Android Studio and fix many minor issues, like:
- make variables private or final and make classes package-private;
- stop creating a new Comparator every time the canvas is drawn;
- rename darp to dsharp and space all lines within 80 columns;
- suppress unused namespace declaration warnings in XMLs;
- refactor so-called "pointless arithmetic expressions";
- take Android context classes out of static fields;
- replace explicit generics with diamond operator;
- and add unrecognized words to dictionary file.

Update arrays and strings and settings XMLs

Update arrays by deleting all the hard-coded items in arrays.xml
and hopefully programmatically initializing them later;
Update strings by adding pitches, accidentals,
and even numeric intervals to strings.xml;
Update settings by merging both intervals
and pitch into settings_possible.xml;
Add different arrays for entries and entryValues;
And add encoding="utf-8"?> to the beginning of all XML files.
Unfortunately, Unicode double sharp and double flat
are still not supported by Android's default font.

Make sendMessage add notes instead

Delete DisplayMessageActivity; change notePosition floats to ints;
Make sendMessage add notes instead; and sort notes by their height.
